def find_last(string,str):
    last_position=-1
    while True:
        position=string.find(str,last_position+1)
        if position==-1:
            return last_position
        last_position=position
def classify0(inX, dataSet, labels, k):
    dataSetSize = dataSet.shape[0]
    diffMat = tile(inX, (dataSetSize,1)) - dataSet
    sqDiffMat = diffMat**2
    sqDistances = sqDiffMat.sum(axis=1)
    distances = sqDistances**0.5
    sortedDistIndicies = distances.argsort()     
    classCount={}
    disc={} 
    distan=0         
    for i in range(k):
        voteIlabel = labels[sortedDistIndicies[i]]
        voteIdistance=distances[sortedDistIndicies[i]]
        distan=distan+voteIdistance
        classCount[voteIlabel] = classCount.get(voteIlabel,0) + 1
        disc[voteIdistance] = disc.get(voteIdistance,0) + 1
    sortedClassCount = sorted(classCount.items(), key=operator.itemgetter(1), reverse=True)
    sorteddisc = sorted(disc.items(), key=operator.itemgetter(1), reverse=True)
    distan=distan/5
    return sortedClassCount[0][0],distan
def file2matrix(filename):
    fr = open(filename)
    numberOfLines = len(fr.readlines())         #get the number of lines in the file
    returnMat = zeros((numberOfLines,60))        #prepare matrix to return
    classLabelVector = []                       #prepare labels return   
    fr = open(filename)
    index = 0
    for line in fr.readlines():
        line = line.strip()
        listFromLine = line.split('\t')
        listFromLine1=listFromLine[0].split('  ') 
        lineSplit2 = list(map(float,listFromLine1))
        returnMat[index,:] = lineSplit2[0:60]
        classLabelVector.append(int(listFromLine1[-1]))
        index += 1
    return returnMat,classLabelVector

